import React, {useContext,useEffect, useState} from 'react'
import Footer from './footer'
import "../App.css"
import { Navigate } from 'react-router-dom'
import axios from "axios"
import { store } from '../App'

const Galary = () => {
  const [token,setToken] = useContext(store);
    

  const [data, setData] = useState(null);

  useEffect(()=> {
    axios.get("http://localhost:5000/galary", {
      headers : {
        "x-token" : token
      }
    }).then(res => setData(res.data)).catch(err => console.log(err)) 
  },[])

  if(!token) {
    return <Navigate to ="/login" />
  }
  console.log(token)

  let imgs = [
    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",

    "https://msoftwebtechnologies.com/images/web_deveolpment.jpg",

    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",


  ]

  return (
    <div style={{backgroundColor:"green", position:"absolute", top:"70px"}}>
      
      <div style={{width:"80%",margin:"auto"}}>
      {imgs.map((val, id)=>(
        <div className="card" style={{width: "18rem",  margin:"10px"}} key={id}>
          <img src={val} className="galary_img" alt="not displayed..." />
          
        </div>
      ))}

      </div>
      <Footer/>
    </div>
  )
}

export default Galary